         */
    final double[] s = new double[DELTA.length];
    s[0] = 1.0;
    for (int i = 1; i < s.length; i++) {
        s[i] = 1.0 + (q + q2 * s[i - 1]);
    }
    /*
         * w = Delta(b) - Delta(a + b)
         */
    final double sqrtT = 10.0 / b;
